import React from 'react';

import { TradingViewEmbed, widgetType } from "react-tradingview-embed";


export default function App() {
  return (
    <div
      className="App"
      style={{background: "rgba(0, 0, 0, 0.85)"}}
    >
      <TradingViewEmbed
        widgetType={widgetType.SCREENER_CRYPTOCURRENCY}
        widgetConfig={{
          colorTheme: "light",
          width: "100%",
          height: "400"
        }}
      />
    </div>
  );
}
